import React from "react";

const Home = () => {
    return (
        <div>
            <section id="home">
                <div className="container">
                    <div className="row justify-content-center">
                        <div className="col-md-8 mt-5">
                            <h1 className="display-2 fw-bolder mb-4 text-center text-white">Nature's canvas, our vision</h1>
                                <p className="lead text-center fs-4 mb-4 text-white">Together we will harness the beauty of nature through your lens</p>
                                    <div className="d-flex justify-content-center">
                                        <button className="btn btn-light me-4 rounded pill px-4 py-2">Check out my gallery!</button>
                                        <button className="btn btn-outline-light me-4 rounded pill px-4 py-2">Get in touch!</button>
                                    </div>
                        </div>
                    </div>
                </div>
            </section>
        </div>
    );
} 

export default Home;
